    "2016-04-28T07:07:14.146181",nt"name": "analysis-neighborhoods",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Department of Public Health and the
    Mayoru2019s Office of Housing and Community Development, with support from the Planning
    Department, created these 41 neighborhoods by grouping 2010 Census tracts, using
    common real estate and residentsu2019 definitions for the purpose of providing consistency
    in the analysis and reporting of socio-economic, demographic, and environmental
    data, and data on City-funded programs and services. They are not codified in Planning
    Code nor Administrative Code.</p><p>This dataset is produced by assigning Census
    tracts to neighborhoods based on existing neighborhood definitions used by Planning
    and MOHCD. A qualitative assessment is made to identify the appropriate neighborhood
    for a given tract based on understanding of population distribution and significant
    landmarks. Once all tracts have been assigned a neighborhood, the tracts are dissolved
    to produce this dataset, Analysis Neighborhoods. It's companion dataset of all Census
    tracts assigned a neighborhood is available here: https://data.sfgov.org/d/bwbp-wk3r</p>",nt"license_title":
